  constructor(props){
    super(props)
    this.state ={
      exampleInputEmail:'',
      exampleInputPassword:''
    }
  }
  changeHandler = (e) => {
    this.setState({[e.target.exampleInputEmail]:e.target.exampleInputPassword})
  }
  submitHandler  =e =>{
    e.preventDefault()
    console.log(this.state)
  }

  render(){
    const {exampleInputEmail,exampleInputPassword} = this.state

  return(
    <div className="bar">
   <Form onSubmit ={this.submitHandler} className ="login-form">
   <h1 className="font-weight-bold"> mywebside.com  </h1>
   <h2>Welcome</h2>
   <FormGroup>
    <Label>Email</Label>
    <input type="email" placeholder="Email"></input>
     <input type="email" placeholder="Email" name ="exampleInputEmail" value ={exampleInputEmail} onChange={this.changeHandler}></input>
    </FormGroup>
    <FormGroup>
    <Label>Password</Label>
     <input type="password" placeholder="Password"  name  ="exampleInputPassword" value ={exampleInputPassword } onChange={this.changeHandler}></input>
    </FormGroup>
    <Button type ="submit" className="btn-lg btn-dark btn-block">Login</Button>
  </Form>
  </div>

  );
  }
}

export default Login;
